function restarDias(fechaExtraida, dias, año ){
  let partesFecha = fechaExtraida.split("/");
  let dia = parseInt(partesFecha[0]);
  let mes = parseInt(partesFecha[1]) - 1; // Los meses en JavaScript son 0-11
  let anio = parseInt(partesFecha[2]);

  // Crear un objeto de fecha
  let fecha = new Date(anio, mes, dia);

  // Obtener el día actual
  let diaActual = fecha.getDate();
  console.log(`Día actual: ${diaActual}`); // Muestra el día actual

  // Restar un día
  fecha.setDate(diaActual - dias);

  fecha.setFullYear(fecha.getFullYear() - año);


  // Convertir de nuevo a formato DD/MM/AAAA
  let diaNuevo = String(fecha.getDate()).padStart(2, '0');
  let mesNuevo = String(fecha.getMonth() + 1).padStart(2, '0'); // Ajustar el mes
  let anioNuevo = fecha.getFullYear();

  return `${diaNuevo}/${mesNuevo}/${anioNuevo}`;
}


