const strings = $input.first().json.CanalVenta;

const groupedByFirstLetter = strings.reduce((acc, currentString) => {
  const firstLetter = currentString[0].toLowerCase(); // Usar la primera letra como clave, en minúsculas para agrupar 'Apple' y 'apple'
  if (!acc[firstLetter]) {
    acc[firstLetter] = []; // Si la clave no existe, inicializa un nuevo array
  }
  acc[firstLetter].push(currentString); // Agrega el string al array correspondiente
  return acc;
}, {}); 

const groupedStringsObject = groupedByFirstLetter;

const counts = {}; 
let mostFrequentString = null;
let maxCount = 0;

for (const key in groupedStringsObject) {
  if (Object.hasOwnProperty.call(groupedStringsObject, key)) {
    const stringArray = groupedStringsObject[key];

    // Iterar sobre cada string dentro del array
    stringArray.forEach(str => {
      // Incrementar el contador para el string actual
      counts[str] = (counts[str] || 0) + 1;

      // Si el contador actual es mayor que el máximo, actualizar
      if (counts[str] > maxCount) {
        maxCount = counts[str];
        mostFrequentString = str;
      }
    });
  }
}


return {CTP: mostFrequentString};
